from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC

from xvfbwrapper import Xvfb

from bs4 import BeautifulSoup


class FetchHtml(object):
    def __init__(self, url):
        self.display = Xvfb()
        self.display.start()
        self.driver = webdriver.Firefox()
        print(url)
        self.driver.get(url)
        try:
            element = WebDriverWait(self.driver, 5).until(
                EC.presence_of_element_located((By.TAG_NAME, "tbody"))
            )
        except selenium.common.exceptions:
            print('Error occur..............')
            self.driver.quit()
        #print(self.driver.page_source)

    def get_tbody_tag(self):
        bs = BeautifulSoup(self.driver.page_source, 'lxml')
        page_div_obj = bs.find_all("td",text=re.compile("mean"))
        result_map = collections.OrderedDict()
        for tag in page_div_obj:
            tag_name = tag.previous_sibling.text
            result_map.setdefault(tag_name,[])
            sibling_list = list(tag.next_siblings)
            #print(sibling_list)
            for sibling in sibling_list[1::2]:
                if re.search('NAN', sibling.text, re.I):
                    sibling_value = min(result_map[tag_name])
                else:
                    sibling_value = sibling.text
                result_map[tag_name].append(re.sub('%','',sibling_value))
        #print(result_map['clients:1'])

        print([(min(value),max(value)) for value in zip(*result_map.values())])

    def close_display(self):
        self.display.stop()



